import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import { Link } from "react-router-dom";
import { useWindowSize } from "./utils";
import { useState } from 'react';


export default function NavBar() {
    const linkages: string[] = [
        "Home",
        "Projects",
        "Contact",
    ];

    const [width, height] = useWindowSize();

    let buttonCSS = {
        border: "rgb(255,255,255,0.25) 0.25px solid",
        borderLeftWidth: 0.5, borderRightWidth: 0.5,
        height: width < 576 ? 100 : 75, color: "white", backgroundColor: "rgb(70,50,120,.85)",
        cursor: "pointer",
    };

    let inBetweenPadding = width < 576 ? 3 : width < 881 ? 15 : 30;


    return <Col sm={12} style={{ verticalAlign: "center", alignContent: "center", textAlign: "center", paddingTop: 25 }} >
        <ul style={{ listStyleType: "none" }}>
            {linkages.map((link, index: number) =>
                <span style={{ paddingLeft: inBetweenPadding, paddingRight: inBetweenPadding, }}><Link className="topLink" to={"/" + (link !== "Home" ? link : "")}><span className="topLink" style={{ fontFamily: "Roboto-Regular", fontSize: 18 }}>{link.replace("-", " ")}</span></Link>
                {width < 580 && index < linkages.length - 1 && " •"}
                </span>
            )}
        </ul>
        <div className="scale">
            <Row style={{ marginLeft: 0,  paddingTop: width < 576 ? 0 : 225, width: "100%" }}>
                <Col xs={6} sm={3} className="hoverTransition" style={buttonCSS} onClick={() => { console.log("click") }}><a style={{ textDecoration: "none", color: "white", }} href="/Attorney-Profiles"><p style={{ textAlign: "center", paddingTop: 20, fontFamily: "Roboto-Regular", fontSize: 16 }}>Fearn Zimmer Elder Law Website</p></a></Col>
                <Col xs={6} sm={3} className="hoverTransition" style={buttonCSS} onClick={() => { console.log("click") }}><a style={{ textDecoration: "none", color: "white", }} href="/https://www.oxfordlitho.com/#/"><p style={{ textAlign: "center", paddingTop: 20, fontFamily: "Roboto-Regular", fontSize: 16 }}>Oxfordlithograph Inc Website</p></a></Col>
                <Col xs={6} sm={3} className="hoverTransition" style={buttonCSS} onClick={() => { console.log("click") }}><a style={{ textDecoration: "none", color: "white", }} href="/https://github.com/Z1mmyNeutron"><p style={{ textAlign: "center", paddingTop: 20, fontFamily: "Roboto-Regular", fontSize: 16 }}>My Github</p></a></Col>

            </Row>
        </div>
    </Col>
}
